import * as React from "react";
import { Link } from "react-router-dom";
import styles from "..";


const CategoryItem = ({ id, name }) => {
    return (
        <Link to={`/${id}`} className={styles.CategoryItems}>
            <span>{ name }</span>
        </Link>
    );
};

export { CategoryItem };
